package com.xedge.jquery.client.model;

public class XYCoOrdinates {
private int x=-1;
private int y=-1;


public XYCoOrdinates() {
	super();
	// TODO Auto-generated constructor stub
}
public XYCoOrdinates(int x, int y) {
	super();
	this.x = x;
	this.y = y;
}
public int getX() {
	return x;
}
public void setX(int x) {
	this.x = x;
}
public int getY() {
	return y;
}
public void setY(int y) {
	this.y = y;
}


}
